            <OwnerCard
              id={game._id}
              key={game._id}
            >
              {game.minPlayers}
            </OwnerCard>
            </Link>
            </ListItem>
        ))}
      </Wrapper>
                    {/* </ul>
                </div>
            </div> */}
        </div>
    );
  }
}

export default Players;
